      "&lt;p&gt;Partido muy reñido desde principio a fin donde en los primeros minutos ambos equipos se han tanteado un poco. El tabu ha contado con varias ocasiones antes del final del 1Q donde los valencianos con menls presión han sabido sufrir más.&lt;/p&gt;&lt;p&gt;A mediados del 2Q tras una jugada tratabillada Benni (con el 98 de carbo a la espalda) ha marcado el primer gol de la historia del CD Giner de los Rios en DHB.&amp;nbsp;&lt;/p&gt;&lt;p&gt;El Giner se ha ido encontrando mejor y ha tenido alguna ocasión más clara.&lt;/p&gt;&lt;p&gt;El partido ha llegado al decanso con victoria por la minima del club local que a principios del 3er cuarto a aprovechado un error en la salida del equipo local para marcar el segundo.&amp;nbsp;&lt;/p&gt;&lt;p&gt;A pocos minutos para el final del 3er cuarto el Tabu acortaba distancias en uno de los varios PC que ha tenido, tras una jugada posterios a este y un gol desde el 2o palo.&lt;/p&gt;&lt;p&gt;Los visitantes han tenido sus mejores minutos y han logrado empatar el partido al inicio del cuarto cuarto donde otro PC ha puesto las tablas sobre el marcador.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Al falta de 5 minutos para el final el equipo local tras una gran jugada de alex ha logrado forzar el PC que daria lugar al resultado final y a una histórica victoria del equipo valenciano, que empieza su etapa en DHB de la mejor manera posible.&lt;/p&gt;",
