    title: "El rol activo de las mujeres en el hockey",
    subtitle:
      "Se acerca el día Internacional de la mujer trabajadora y en nuestro club queremos hacer hincapié en el  rol activo de las mujeres en el hockey.",
    new:
      "&lt;p&gt;El rol activo de las mujeres en el hockey, desde Giner de los Ríos club de hockey queremos darle visibilidad al rol activo de la mujer en nuestro deporte. Aprovechamos la proximidad con el día Internacional de la mujer trabajadora para lanzar una campaña en redes sociales, &amp;nbsp;del 2 al 8 de marzo ellas serán las estrellas bajo el HT &amp;nbsp;&lt;b&gt;#MujeresEnElHockey.&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;El deporte constituye un motor de cambio social y contribuye &amp;nbsp;a promover la igualdad entre mujeres y hombres, siendo&amp;nbsp;&amp;nbsp;fundamental promover dicha equidad.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Queremos un futuro con más mujeres que gocen del deporte y de los beneficios que éste conlleva, así como un mayor número de mujeres implicadas en todos los aspectos que involucran el deporte: la dirección y la gestión, el entrenamiento, el arbitraje, el periodismo y la práctica deportiva.&lt;/p&gt;&lt;p&gt;&lt;i&gt;Lo sabías?&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;background-color: initial;&quot;&gt;Giner de los Ríos es un club plural, somos el único club valenciano con presidencia&amp;nbsp;femenina, &amp;nbsp;llevamos dos legislaturas con este cargo ocupado por mujeres. Pilar Escriche y en la actualidad Esther de Pedro, además de delegadas tanto en equipos masculinos como femeninos. En nuestro club contamos con el 54% de licencias femeninas&amp;nbsp;y un 46% masculinas.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;Algunos datos de interés:&lt;/i&gt;&lt;/p&gt;&lt;p&gt;El hockey es un deporte muy antiguo, hay registros gráficos en la época de los egipcios. Igualmente, existe registro en la Edad Media en Europa. Se cree también que se pudo haber originado en Asia, en lo que hoy se conoce como &amp;nbsp;India y, de ahí, los colonos británicos pudieron haberlo adoptado y llevado a Europa. A&lt;span style=&quot;background-color: initial;&quot;&gt;&amp;nbsp;partir de &amp;nbsp;1880 el juego se asentó definitivamente y las mujeres comenzaron a practicarlo con entusiasmo.&amp;nbsp;&lt;/span&gt;Actualmente el hockey sobre césped está dominado internacionalmente por países como Alemania, Holanda, Inglaterra, España, Argentina, Australia o China. Las Leonas de Argentina son un ejemplo del triunfo del hockey femenino a nivel mundial por la deportividad y el impacto mediático.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;background-color: initial;&quot;&gt;Ya sabes, del 2 al 8 te esperamos por las redes de Giner para rendir homenaje a las&amp;nbsp;&lt;/span&gt;&lt;b&gt;#MujeresEnElHockey&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;background-color: initial;&quot;&gt;También te puede interesar:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;http://ginerdelosrios.es/noticias/2016-12-05/es/el-hockey-femenino-en-auge-en-la-comunidad-valenciana&quot;&gt;http://ginerdelosrios.es/noticias/2016-12-05/es/el-hockey-femenino-en-auge-en-la-comunidad-valenciana&lt;/a&gt;&lt;span style=&quot;background-color: initial;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;",
