    title: "Los valores del hockey: deportividad",
    subtitle:
      "En este artículo hacemos hincapié en los valores del hockey, en la deportividad.",
    new:
      "&lt;p&gt;&lt;b&gt;¿Qué es la deportividad?&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Según la RAE: Actuación correcta y educada que se debe guardar en todo deporte.&lt;br&gt;\r\n&lt;/p&gt;\r\n\r\n&lt;p&gt;En otras entradas hemos hablado de los &lt;b&gt;valores y beneficios del hockey&lt;/b&gt;. También de las &lt;b&gt;Escuelas Deportivas Municipales&lt;/b&gt; y la oportunidad de incorporar este deporte desde la escuela y la infancia. Hoy dentro de la temática valores y deportividad, transcribimos un texto de una madre y su experiencia. Para nosotros, los que &amp;nbsp;fomentamos este deporte, es una gran motivación. Porque representa el resultado de una actuación que comienza en objetivos transversales y se llevan a cabo gracias a la profesionalidad de nuestros jóvenes entrenadores. Esta experiencia de una mamá, es resultado de una labor, de un conjunto de acciones.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Por María Angeles:&amp;nbsp;&lt;br&gt;&lt;b&gt;\r\n AGRADECIMIENTO Y REFLEXIÓN&lt;/b&gt;&lt;br&gt;\r\n este sábado el equipo de hockey del colegio de mi hijo CEIP 9 de Octubre tenía partido contra los chiquillos de equipo Santangel B, En nuestro equipo solamente eramos 5 jugadores ( no sé sí sabréis que para poder jugar hacen falta 6 jugadores y el portero). Así empezó el partido y nos marcaron 3 puntos ( los papis y mamis de nuestro equipo pensamos ¨la que les va a caer a nuestros hijos¨).Pero NO , a partir de ese momento vimos algo que nos dejó asombrados, vimos que, cuando los jugadores del Santangel B tenían la oportunidad de marcar, tiraban la pelota atrás o se avisaban entre ellos para que no marcaran.&amp;nbsp;&lt;/p&gt;&lt;p&gt;El partido termino 3-1.&amp;nbsp;&lt;br&gt;\r\n Por eso mi agradecimiento. Pudieron marcar mas puntos y no lo hicieron, sabían que iban a ganar y no necesitaron marcar goles que hubieran dejado a nuestros jugadores muy hundidos. GRACIAS.&lt;br&gt;&lt;b&gt;\r\n Y ahora mi reflexión:&amp;nbsp;&lt;/b&gt;&lt;br&gt;\r\n La lección de deportividad que nos dan nuestros hijos, ojala los mayores aprendamos de los niños. Ellos juegan no sólo para ganar, sino como me dijo mi hijo ¨yo juego para divertirme, aprender , conocer niños-as nuevos y estar con mis amigo-as&lt;br&gt;\r\n&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Relacionado:&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://ginerdelosrios.es/noticias/2016-11-21/es/beneficios-de-la-practica-del-hockey&quot;&gt;http://ginerdelosrios.es/noticias/2016-11-21/es/beneficios-de-la-practica-del-hockey&lt;/a&gt;&lt;br&gt;\r\n&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://ginerdelosrios.es/noticias/2017-11-02/es/escuelas-deportivas-municipales-hockey-en-la-escuela&quot;&gt;http://ginerdelosrios.es/noticias/2017-11-02/es/escuelas-deportivas-municipales-hockey-en-la-escuela&lt;/a&gt;&lt;br&gt;\r\n&lt;/p&gt;\r\n&lt;iframe width=&quot;560&quot; height=&quot;315&quot; src=&quot;https://www.youtube.com/embed/oBILGsGS4tc&quot; frameborder=&quot;0&quot; allow=&quot;autoplay; encrypted-media&quot; allowfullscreen=&quot;&quot;&gt;&lt;/iframe&gt;",
