    _id: 426,
    lang: "es",
    title: "Escuelas Deportivas Municipales:  Hockey en la escuela",
    subtitle:
      "Las Escuelas Deportivas Municipales son un programa de actuación sobre la población escolar de 4 a 18 años",
    new:
      "&lt;p&gt;Las Escuelas Deportivas Municipales son un programa de actuación sobre la&amp;nbsp;&lt;strong&gt;población escolar de 4 a 18 años&lt;/strong&gt;, que trata de facilitar la iniciación a la práctica deportiva, con los beneficios para la salud que comporta, y al mismo tiempo inculcar los valores del deporte.&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Cada año se suman más escuelas, &amp;nbsp;que abren sus puertas a nuestro deporte, el Hockey, a través de las escuelas deportivas municipales.&amp;nbsp;&lt;/p&gt;&lt;p&gt;La actividad de las Escuelas Deportivas Municipales, se adapta a las necesidades y el desarrollo de cada etapa educativa, tanto en Infantil, como en Primaria y Secundaria. &amp;nbsp;Asimismo, la Fundación Deportiva Municipal garantiza seguridad y calidad educativa con la presencia de profesionales titulados para dirigir las diferentes actividades.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Debido a los excelentes resultados obtenidos a través de la intervención en la juventud de las escuelas deportivas, se las considera la cantera Olímpica.&amp;nbsp;&lt;/p&gt;&lt;p&gt;las Escuelas Deportivas Municipales incluye 20 disciplinas: ajedrez, atletismo, bádminton, baloncesto, balonmano, esgrima, gimnasia rítmica, gimnasia artística, hockey, karate, lucha, frontenis, voleibol, fútbol-sala, tenis de mesa, pilota valenciana, piragüismo, pádel, waterpolo, judo y orientación.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;De las EEDDMM de FESA a los Juegos Paralímpicos de Río&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;De estas escuelas deportivas que la Fundación Deportiva Municipal organiza en colaboración con las federaciones deportivas han surgido también algunos de los atletas que están compitiendo estos días en los Juegos Paralímpicos de Río, como Kim López, medalla de oro en lanzamiento, Mónica Merenciano, diploma en judo, o David Casinos entre otros.&lt;/p&gt;&lt;p&gt;Más en Web Ayuntamiento de Valencia Escuelas Deportivas Municipales&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Carta de Bienvenida al Hockey: &amp;nbsp;C.D. Giner de Los Ríos&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Bienvenidas al hockey, bienvenidos al Club Deportivo Giner\r\nde los Ríos.\r\nVuestros hijos e hijas han elegido la práctica de este deporte,\r\nactividad que organiza la Fundación Deportiva Municipal y que\r\ngestiona nuestro club. L@s monitor@s que les acompañan forman\r\nparte del Giner o colaboran con él.\r\nEste grupo de monitor@s están formados especialmente para\r\nacompañar a vuestros hijos e hijas en el aprendizaje del hockey que,\r\ncomo deporte de equipo, ayuda a transmitir valores como el\r\ncompañerismo, la disciplina y la responsabilidad, junto con los\r\nbeneficios que por si misma proporciona la práctica deportiva.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Nuestro club tiene más de 20 años de existencia. Tenemos equipos\r\nmasculinos y femeninos desde la categoría de iniciación hasta la\r\nsenior. Y jugamos a hockey sala y hockey hierba.\r\nVuestros hijos e hijas y vosotros mismos tenéis un sitio en nuestro\r\nclub.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Síguenos en Facebook, Twitter e Instagram&lt;/p&gt;&lt;p&gt;Perfil en Facebook\r\n(cdginerdelosrios), en Instagram (ginerdelosrioshockey), Twitter (Hockey_Giner)&lt;br&gt;&lt;/p&gt;",
